import { useParams } from 'react-router-dom';

function PostsTitle() {
    const {title} = useParams();
    return (
      <div>
        <h2>Enter the text after the "/" sign.</h2>
        <h3>{title}</h3>
      </div>
    )
}
  
export {PostsTitle};
